description:
School is back. The night is cold. Take a break from writing papers and join the SUS family at our FREE PokéBowl dinner event. YES you heard that right! Free food! Warm atmosphere. Chill people. It’s hard to say no.

Pikachu and his friends are here to provide all the necessary ingredients to make a delicious Poké. All you need to bring is yourself, a couple of friends, and get ready for a relaxing night complete with good food and warm company. 

Checkout the rest of SUS Science Week 2017: {{{http://bit.ly/SciWeek2017}}}
